import { Link } from 'react-router-dom';
import { useState } from "react";

import './Nav.css';

export default function Nav() {
  const [videos, setVideos ] = useState([])


  return (
    <header className="nav-wrapper">
      <h1>
        <Link to="/">YouTube</Link>
      </h1>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}
